import React from "react";

function Movie({ title, poster }) {
  return (
    <div>
      <h1>I like {title}</h1>
      <img src={poster} />
    </div>
  );
}

const movieILike = [
  {
    title: "아이언맨",
    poster:
      "https://www.google.com/url?sa=i&url=http%3A%2F%2Fm.blog.naver.com%2Fkimmisung08%2F220183309404&psig=AOvVaw3ExEmpiu-Qw_UuMUEMIcA6&ust=1620995918899000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPCE3sLWxvACFQAAAAAdAAAAABAD",
  },
  {
    title: "토르",
    poster:
      "https://www.google.com/url?sa=i&url=http%3A%2F%2Fwww.topstarnews.net%2Fnews%2FarticleView.html%3Fidxno%3D38797&psig=AOvVaw1IFqrfgb4coahrAdxUVW72&ust=1620995977161000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCLiy893WxvACFQAAAAAdAAAAABAY",
  },
  {
    title: "퍼스트 어벤저",
    poster:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fko.wikipedia.org%2Fwiki%2F%25ED%258D%25BC%25EC%258A%25A4%25ED%258A%25B8_%25EC%2596%25B4%25EB%25B2%25A4%25EC%25A0%25B8&psig=AOvVaw1DlG8i5taej2HtF3JqaHjY&ust=1620996043342000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCIDP1f3WxvACFQAAAAAdAAAAABAD",
  },
  {
    title: "헐크",
    poster:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fstephan.tistory.com%2F836&psig=AOvVaw1HuMFQQbTGuGNu0xqgD-S3&ust=1620996081596000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKDio4_XxvACFQAAAAAdAAAAABAJ",
  },
];

function App() {
  return (
    <div>
      {movieILike.map((like) => (
        <Movie title={like.title} poster={like.poster} />
      ))}
    </div>
  );
}

export default App;
